htmlContent.original:
reading jessica riskin's "machines in the garden":
- early catholic churches actually patronized mechanical automata (moving angels/christ/devils);
- for a time, being mechanical and being divine were not contradictory. machines could channel grace;
- reformation changed that: "one could not
know a thing to be mechanical and simultaneously believe it to be divine".

i wonder if this is the origin of a long inheritance, the modern "artificial anxiety": the fear that to be human-made is to be fake, and intelligence born from mechanism can never be as good. by extension, this view also holds there's an unbridgeable gap between any artificial processes and biological evolution.

